import React from "react";
import styled from 'styled-components';

const Container = styled.div`
    border-bottom: 1px solid grey;
    height: 100px;
`;

const Box = styled.div`
        border-bottom: 1px solid grey;
`;
const SecondTop = () => { 
    return(
        <Container>
            <Box>
            여기는 두번째 헤더
            </Box>

        </Container>
    );
}

export default SecondTop;
